import React from 'react'
import Container from 'react-bootstrap/Container';
import styled from 'styled-components';
import Typography from '@mui/material/Typography';
import leftbg from "../assets/images/left-bg.png";

const Team = () => {
  const Teamwrapper = styled.div`
    position: relative;
    background-color: white;
    background-image: url(${leftbg});
    background-size: auto;
    background-repeat: no-repeat;
    background-position: top left;
  h3{
     color:${({theme})=>theme.colors.headeractive};
     font-family:inherit;
     margin-bottom:20px;
     margin-top:0px!important;
   }
   span{
        color:${({theme})=>theme.colors.text7};
        position: relative;
        font-size:14px;
  }

  .team_member{

  }
  
  const teamlist = [
    {
      name:'anil',
      middleName:"ramesh",
      surname:'kapse',
      area:'khattalwada',
      position:'team lead'
    },
    {
      name:'anil',
      middleName:"ramesh",
      surname:'kapse',
      area:'khattalwada',
      position:'team lead'
    },
    {
      name:'anil',
      middleName:"ramesh",
      surname:'kapse',
      area:'khattalwada',
      position:'team lead'
    },
    {
      name:'anil',
      middleName:"ramesh",
      surname:'kapse',
      area:'khattalwada',
      position:'team lead'
    },
    {
      name:'anil',
      middleName:"ramesh",
      surname:'kapse',
      area:'khattalwada',
      position:'team lead'
    },
    {
      name:'anil',
      middleName:"ramesh",
      surname:'kapse',
      area:'khattalwada',
      position:'team lead'
    },
    {
      name:'anil',
      middleName:"ramesh",
      surname:'kapse',
      area:'khattalwada',
      position:'team lead'
    },
    {
      name:'anil',
      middleName:"ramesh",
      surname:'kapse',
      area:'khattalwada',
      position:'team lead'
    },
  ]
  
  `
  return (
    <Teamwrapper>
      <Container className='announcementwrapper common_margin'>
        <Typography variant="h3" className='mt-3'>Teams</Typography>
        <span>below are the Team members list</span>
        <section className='team_member'>
          <div className='card'>
              <div className='team_image'>
                <img src="https://anilkapse1.github.io/kapsecode/assets/user-eaef6175.png" alt="username"/>
              </div>
              <div className='c'></div>
          </div>
        </section>
      </Container>
    </Teamwrapper>
  )
}

export default Team
